import React, { Component } from 'react';
//import '../css/paginaCadastroSucesso.css';
import { Link, Redirect } from 'react-router-dom';
import { Table } from 'reactstrap';
//import logo from '../images/sucesso.png';

class Busca_Sucesso extends Component {
    constructor(props){
        super(props);
    }
    render() {
        const data = [{
            cpf: this.props.cpf,
            num_matric: this.props.num_matric,
            name: this.props.nome,     
            email: this.props.email,
            dataNascimento: this.props.dataNascimento,
            telefone: this.props.telefone,
        }]

        const columns = [{
          Header: 'CPF',
          accessor: 'cpf' // String-based value accessors!
        },{
          Header: 'Número de Matrícula',
          accessor: 'num_matric',
        },{
            Header: 'Nome',
            accessor: 'name',
        },{
            Header: 'E-mail',
            accessor: 'email',
        },{
            Header: 'Data de Nascimento',
            accessor: 'dataNascimento',
        },{
            Header: 'Telefone de Contato',
            accessor: 'telefone',
        }]
           
        return <ReactTable
          data={data}
          columns={columns}
        />
      }
}
export default Busca_Sucesso;
